// frontend/src/components/PoliceAddForm.js
import React, { useState } from 'react';
import axios from 'axios';

const PoliceAddForm = ({ token }) => {
  const [form, setForm] = useState({ comisaria: '', elemento: '', marca: '', modelo: '', nro_serie: '', nro_motor: '', nro_cuadro: '', patente: '', caracteristicas: '', denunciante: '', dni: '' });

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/api/objetos', form, {
        headers: { Authorization: token }
      });
      alert('Elemento registrado');
      setForm({ comisaria: '', elemento: '', marca: '', modelo: '', nro_serie: '', nro_motor: '', nro_cuadro: '', patente: '', caracteristicas: '', denunciante: '', dni: '' });
    } catch (err) {
      alert('Error al registrar');
    }
  };

  return (
    <form onSubmit={handleSubmit} className="space-y-2">
      {Object.entries(form).map(([key, value]) => (
        <input key={key} name={key} value={value} onChange={handleChange} placeholder={key} className="border p-2 w-full" />
      ))}
      <button type="submit" className="bg-green-600 text-white px-4 py-2 rounded">Registrar</button>
    </form>
  );
};

export default PoliceAddForm;
